function onClick(e){document.getElementById("img01").src=e.src,document.getElementById("modal01").style.display="block",document.getElementById("caption").innerHTML=e.alt}function myFunction(){var e=document.getElementById("myNavbar");document.body.scrollTop>100||document.documentElement.scrollTop>100?e.className="w3-bar w3-card w3-animate-top w3-white":e.className=e.className.replace(" w3-card w3-animate-top w3-white","")}function toggleFunction(){var e=document.getElementById("navDemo");-1==e.className.indexOf("w3-show")?e.className+=" w3-show":e.className=e.className.replace(" w3-show","")}window.onscroll=function(){myFunction()};